import React from "react";

const PageNavigation = () => {
  return (
    <div className="pageNav-container">
      <ul className="pagination">
        <li className="page-item">
          <a>1</a>
        </li>
        <li className="page-item">
          <a>2</a>
        </li>
        <li className="page-item">
          <a>3</a>
        </li>
      </ul>
    </div>
  );
};

export default PageNavigation;
